import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { SharedModule } from 'app/shared/shared.module';
import { FontAwesomeModule } from '@fortawesome/angular-fontawesome';
import { AutoCompleteModule } from 'primeng/autocomplete';
import { ButtonModule } from 'primeng/button';
import { CalendarModule } from 'primeng/calendar';
import { CheckboxModule } from 'primeng/checkbox';
import { ConfirmPopupModule } from 'primeng/confirmpopup';
import { DialogModule } from 'primeng/dialog';
import { DropdownModule } from 'primeng/dropdown';
import { FormsModule, ReactiveFormsModule } from '@angular/forms';
import { InputTextModule } from 'primeng/inputtext';
import { MultiSelectModule } from 'primeng/multiselect';
import { PanelModule } from 'primeng/panel';
import { TableModule } from 'primeng/table';
import { ToastModule } from 'primeng/toast';
import { TooltipModule } from 'primeng/tooltip';
import { SplitButtonModule } from 'primeng/splitbutton';
import { ConfirmationService, MessageService } from 'primeng/api';
import { DialogService } from 'primeng/dynamicdialog';
import { NspConfirmationService } from 'app/shared/confirm/nsp-confirm.service';
import { IcCodeService } from 'app/ng-connect';
import { FormlyMapService } from 'app/shared/service/formly-map.service';
import { ToolbarModule } from 'primeng/toolbar';
import { ECClaimRoutingModule } from './route/ec-claim-routing.module';
import { EditHardcopyEcComponent } from './edit-hardcopy-ec/edit-hardcopy-ec.component';
import { ViewCpfComponent } from './pop-up/view-cpf/view-cpf.component';
import {AccordionModule} from 'primeng/accordion';
import { EmpClaimVerificationComponent } from './ec-claim-verification/ec-claim-verification.component';
import { ClaimSectionComponent } from './ec-claim-verification/claim-section/claim-section.component';
import { CompanySectionComponent } from './ec-claim-verification/company-section/company-section.component';
import { ActualTrgDetailSectionComponent } from './ec-claim-verification/actual-training-detail-section/actual-training-detail-section.component';
import { ItemChangeHistorySectionComponent } from './ec-claim-verification/item-change-history-section/item-change-history-section.component';
import {UserService} from "app/admin/access-control";
import { ViewLatestOwnerEcComponent } from './pop-up/view-latest-owner-ec/view-latest-owner-ec.component';
import { ViewCpfDeviationComponent } from './pop-up/view-cpf-deviation/view-cpf-deviation.component';
import { ViewEClaimComponent } from './pop-up/view-eclaim/view-eclaim.component';
import { ViewEClaimSectionComponent } from './pop-up/view-eclaim/claim-section/view-eclaim-claim-section.component';
import { ViewEClaimCompanySectionComponent } from './pop-up/view-eclaim/company-section/view-eclaim-company-section.component';
import { ViewEClaimAdditionalInfoSectionComponent } from './pop-up/view-eclaim/additional-info-section/view-eclaim-additional-info-section.component';

@NgModule({
  declarations: [
    EditHardcopyEcComponent,
    ViewCpfComponent,
    EmpClaimVerificationComponent,
    ClaimSectionComponent,
    CompanySectionComponent,
    ActualTrgDetailSectionComponent,
    ItemChangeHistorySectionComponent,
    ViewLatestOwnerEcComponent,
    ViewCpfDeviationComponent,
    ViewEClaimComponent,
    ViewEClaimSectionComponent,
    ViewEClaimCompanySectionComponent,
    ViewEClaimAdditionalInfoSectionComponent
  ],
  imports: [
    CommonModule,
    SharedModule,
    AutoCompleteModule,
    ButtonModule,
    CalendarModule,
    CheckboxModule,
    ConfirmPopupModule,
    DialogModule,
    DropdownModule,
    FontAwesomeModule,
    FormsModule,
    ReactiveFormsModule,
    InputTextModule,
    MultiSelectModule,
    PanelModule,
    TableModule,
    ToastModule,
    TooltipModule,
    ToolbarModule,
    AccordionModule,
    ECClaimRoutingModule,
    SplitButtonModule

  ],
  providers: [ConfirmationService, MessageService, DialogService, NspConfirmationService, IcCodeService, FormlyMapService,
    UserService]
})
export class ECClaimModule { }
